[Form]
public class DNRParameters extends FormRun
{
    NumberSeqReference                  numberSeqRef;
    boolean                             runExecuteDirect;
    TmpIdRef                            tmpIdRef;
    NumberSeqScope                      scope;
    NumberSeqApplicationModule          numberSeqApplModule;
    container                           numberSeqModules;
    DNRSortingFormHelper                sortingHelper;
    QueryBuildRange                     qbrTypeGroup;
    Map                                 taxBookSectionIdCache;

}

[SuppressBPWarningAttribute("BPCheckInvalidInitFormMethodInfo", "Number sequences must be initialized before invoking super()")]
public void init()
{
    this.numberSeqPreInit();

    super();

    sortingHelper = new DNRSortingFormHelper(RAGRentalTypeGroupSorting_ds, fieldNum(RAGRentalTypeGroupSorting, LineNum), ButtonSortingUp, ButtonSortingDown);

    RORParameters::find();
    RAGParameters::find();

    this.numberSeqPostInit();

    RAGContractTypePriority::checkCreateData();
}

public void numberSeqPreInit()
{
    runExecuteDirect    = false;
    numberSeqModules    = [ NumberSeqModule::RORRentalOrders, NumberSeqModule::RAGRentalAgreements ];
    numberSeqApplModule = new NumberSeqModuleRORRentalOrders();
    scope               = NumberSeqScopeFactory::createDataAreaScope();

    NumberSeqApplicationModule::createReferencesMulti(numberSeqModules, scope);
    tmpIdRef.setTmpData(NumberSequenceReference::configurationKeyTableMulti(numberSeqModules));
}

public int active()
{
    int ret;

    ret = super();

    element.rorParametersUpdateDesign();

    return ret;
}

public void executeQuery()
{
    if(runExecuteDirect)
    {
        super();
    }
    else
    {
        runExecuteDirect = true;
        this.queryRun(NumberSeqReference::buildQueryRunMulti(numberSequenceReference,
                                                             tmpIdRef,
                                                             numberSequenceTable,
                                                             numberSeqModules,
                                                             scope));
        numberSequenceReference_ds.research();
    }
}

[SysClientCacheDataMethodAttribute(true)]
display public TaxBookSectionId taxBookSectionId()
{
    NumberSequenceTable numberSequenceTableLocal;
    TaxBookSectionId locTaxBookSectionId = '';

    if (!taxBookSectionIdCache)
    {
        taxBookSectionIdCache = new Map(Types::Int64, Types::String);
    }

    if (NumberSequenceReference.NumberSequenceId)
    {
        if (taxBookSectionIdCache.exists(NumberSequenceReference.NumberSequenceId))
        {
            locTaxBookSectionId = taxBookSectionIdCache.lookup(NumberSequenceReference.NumberSequenceId);
        }
        else                    
        {
            select firstonly RecId from numberSequenceTableLocal
            where numberSequenceTableLocal.RecId == NumberSequenceReference.NumberSequenceId;

            if (numberSequenceTableLocal.RecId)
            {
                locTaxBookSectionId = TaxBookSection::findVoucherSeries(numberSequenceTableLocal.RecId).TaxBookSectionId;

                if (locTaxBookSectionId)
                {
                    taxBookSectionIdCache.insert(NumberSequenceReference.NumberSequenceId, locTaxBookSectionId);                            
                }
            }
        }
    }

    return locTaxBookSectionId;
}

