public void changePriority(boolean _moveUp = false)
{

    RAGContractTypePriority contractTypePriority;
    Priority                selectedLinePriority = RAGContractTypePriority.Priority;

    if (_moveUp)
    {
        select firstonly forupdate contractTypePriority
        where contractTypePriority.Priority == (selectedLinePriority + 1);
    }
    else
    {
        select firstonly forupdate contractTypePriority
        where contractTypePriority.Priority == (selectedLinePriority - 1);
    }

    if (contractTypePriority.RecId)
    {
        ttsbegin;
        RAGContractTypePriority.Priority = contractTypePriority.Priority;
        RAGContractTypePriority.write();

        contractTypePriority.Priority = selectedLinePriority;
        contractTypePriority.update();
        ttscommit;
    }

    RAGContractTypePriority_ds.research(true);
}

[SysClientCacheDataMethodAttribute(true)]//Fati
public display Description displayPriority(RAGContractTypePriority _contractTypePriority)
{
    #define.HighPriority("High priority")
    #define.LowPriority("Low priority")

    Description priorityStr;

    switch(_contractTypePriority.Priority)
    {
        case 1:
            priorityStr = #LowPriority;
            break;

        case 11:
            priorityStr = #HighPriority;
            break;

        default:
            priorityStr = '';
    }

    return priorityStr;
}

